import React, { Component } from "react";
import { Link } from "react-router-dom";
import SideNavigation from "./SideNavigation";

class HeaderLeft extends Component {
  render() {
    var { togglenav } = this.props;
    return (
      <div className="col header-left p-0">
        <SideNavigation />
        <ul className="nav menu align-items-center">
          <li className="nav-item">
            <button
              onClick={() => this.props.onToggleNav()}
              className="btn shadow-none far fa-bars size-18"
            ></button>
          </li>
          <li className="nav-item">
            <Link className="text-decoration-none" to="/admin">
              Home
            </Link>
          </li>
          <li className="nav-item">
            <Link className="text-decoration-none" to="/admin/users">
              Users
            </Link>
          </li>
          <li className="nav-item">
            <Link className="text-decoration-none" to="/admin">
              Settings
            </Link>
          </li>
        </ul>
      </div>
    );
  }
}

export default HeaderLeft;
